import{_ as t,o as a,c as s,e as i}from"./app-81765434.js";const n={};function o(r,e){return a(),s("div",null,e[0]||(e[0]=[i('<h1 id="generate-dummies" tabindex="-1"><a class="header-anchor" href="#generate-dummies" aria-hidden="true">#</a> Generate Dummies</h1><h2 id="overview" tabindex="-1"><a class="header-anchor" href="#overview" aria-hidden="true">#</a> Overview</h2><p>The Generate Dummies plugin offers a convenient solution for users looking to streamline the testing and development process. With this plugin, users can easily generate simulated or dummy accounts within the Ultimate Member framework. This tool is especially useful for testing and development purposes, allowing website administrators and developers to generate dummy accounts systematically. By simulating user interactions, the plugin assists in evaluating and fine-tuning the functionality of the Ultimate Member plugin before deploying it to a live audience. This feature-rich extension simplifies the testing process, ensuring a smoother and more reliable user experience.</p><h3 id="generate-dummies-tab" tabindex="-1"><a class="header-anchor" href="#generate-dummies-tab" aria-hidden="true">#</a> Generate Dummies Tab</h3><p>Upon activating the plugin, a new tab, <strong>&quot;Generate Dummies,&quot;</strong> is added to the Ultimate Member Menu. Navigate to <strong>wp-admin &gt; Ultimate Member &gt; Generate Dummies.</strong></p><p><img src="https://s3.amazonaws.com/helpscout.net/docs/assets/561c96629033600a7a36d662/images/654f26f5687c016dc15b761c/file-CbRBVcF9jK.png" alt=""></p><h3 id="settings" tabindex="-1"><a class="header-anchor" href="#settings" aria-hidden="true">#</a> Settings</h3><p>Customize dummy accounts in the Generate Dummies Settings:</p><ul><li><strong>How many dummies?:</strong> Set the number of dummies you want to generate.</li><li><strong>Available Nationalities:</strong> Choose from various nationalities for the generated dummies. <ul><li>(AU, BR, CA, CH, DE, DK, ES, FI, FR, GB, IE, IR, NL, NZ, TR, US)</li></ul></li><li><strong>Gender:</strong> Specify the gender of the dummies (male, female, or both).</li><li><strong>Generate Random Colored Cover Photos:</strong> Enable dummies&#39; profiles to have randomly colored cover photos.</li><li><strong>Notification:</strong> Disable email notifications to admins when dummies are generated.</li><li><strong>Account Email Pattern:</strong> Set email patterns for dummy accounts.</li><li><strong>Account Passwords:</strong> Set passwords for dummy accounts.</li></ul><p>After configuring settings, click <strong>&quot;Start Generating Dummies&quot;</strong> to create them. Use <strong>&quot;Remove Generated Dummies&quot;</strong> to clear generated dummies.</p><p><img src="https://s3.amazonaws.com/helpscout.net/docs/assets/561c96629033600a7a36d662/images/654f27da2d28585006d0177d/file-LDfm5MWUBA.png" alt=""></p><h3 id="clear-user-cache" tabindex="-1"><a class="header-anchor" href="#clear-user-cache" aria-hidden="true">#</a> Clear User Cache</h3><p>Go to <strong>wp-admin &gt; Ultimate Member &gt; Dashboard &gt; User Cache.</strong> You need to clear the user cache to refresh data; this is needed if the generated dummies&#39; profiles and cover photos do not appear. Once you click the clear cache button, a confirmation message will indicate that the cache has been removed.</p><p><img src="https://s3.amazonaws.com/helpscout.net/docs/assets/561c96629033600a7a36d662/images/654f2933687c016dc15b761d/file-QjdMeS6V2d.png" alt=""></p><p><img src="https://s3.amazonaws.com/helpscout.net/docs/assets/561c96629033600a7a36d662/images/654f2acd8fd0677319115f23/file-DwPAyyRW8K.png" alt=""></p><p>Check the generated dummies in <strong>wp-admin &gt; Users</strong>. Hover over a dummy user and click <strong>&quot;View Profile&quot;</strong> to see the dummy account&#39;s profile.</p><p><img src="https://s3.amazonaws.com/helpscout.net/docs/assets/561c96629033600a7a36d662/images/654f2c672d28585006d0177e/file-obYecRrLaC.png" alt=""></p><p><img src="https://s3.amazonaws.com/helpscout.net/docs/assets/561c96629033600a7a36d662/images/654f2d40687c016dc15b761e/file-k6jGYwXLzZ.png" alt=""></p>',18)]))}const c=t(n,[["render",o],["__file","1666-generate-dummies.html.vue"]]);export{c as default};
